function App() {

  return (
          <Container fixed>

              <Grid container spacing={2}>
                  <Grid item xs={6} md={8}>
                      <Item>xs=6 md=8</Item>
                  </Grid>
                  <Grid item xs={6} md={4}>
                      <Item>xs=6 md=4</Item>
                  </Grid>
                  <Grid item xs={6} md={4}>
                      <Item>xs=6 md=4</Item>
                  </Grid>
                  <Grid item xs={6} md={8}>
                      <Item>xs=6 md=8</Item>
                  </Grid>
              </Grid>

          </Container>

  );
}

export default App;
